mapper.select:

select 

from skf.skf3010_m_shataku_manege
where shataku_kanri_no = #{shatakuKanriNo,jdbcType=NUMERIC}
  and manege_kbn = #{manegeKbn,jdbcType=VARCHAR}

mapper.delete:

delete from skf.skf3010_m_shataku_manege
where shataku_kanri_no = #{shatakuKanriNo,jdbcType=NUMERIC}
  and manege_kbn = #{manegeKbn,jdbcType=VARCHAR}
